CREATE TABLE Branches (
    BranchID INT PRIMARY KEY,
    BranchName VARCHAR(100),
    Address VARCHAR(255),
    City VARCHAR(50),
    State VARCHAR(50),
    ZipCode VARCHAR(10),
    PhoneNumber VARCHAR(20),
    ManagerName VARCHAR(100),
    OpeningDate DATE
);

CREATE TABLE Customers (
    CustomerID INT PRIMARY KEY,
    BranchID INT,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    MiddleName VARCHAR(50),
    DateOfBirth DATE,
    Gender CHAR(1),
    PassportNumber VARCHAR(20),
    Address VARCHAR(255),
    PhoneNumber VARCHAR(20),
    Email VARCHAR(100),
    FOREIGN KEY (BranchID) REFERENCES Branches(BranchID)
);

CREATE TABLE Accounts (
    AccountID INT PRIMARY KEY,
    CustomerID INT,
    AccountNumber VARCHAR(20),
    AccountType VARCHAR(20),
    Balance DECIMAL(18, 2),
    Currency VARCHAR(4),
    OpenDate DATE,
    CloseDate DATE,
    Status VARCHAR(20),
    FOREIGN KEY (CustomerID) REFERENCES Customers(CustomerID)
);

CREATE TABLE Transactions (
    TransactionID INT PRIMARY KEY,
    AccountID INT,
    TransactionDate DATE,
    Amount DECIMAL(18, 2),
    TransactionType VARCHAR(20),
    Description VARCHAR(255),
    Currency VARCHAR(4),
    Status VARCHAR(20),
    FOREIGN KEY (AccountID) REFERENCES Accounts(AccountID)
);

CREATE TABLE Loans (
    LoanID INT PRIMARY KEY,
    CustomerID INT,
    LoanType VARCHAR(20),
    PrincipalAmount DECIMAL(18, 2),
    InterestRate DECIMAL(5, 2),
    StartDate DATE,
    EndDate DATE,
    Status VARCHAR(20),
    FOREIGN KEY (CustomerID) REFERENCES Customers(CustomerID)
);

CREATE TABLE LoanPayments (
    PaymentID INT PRIMARY KEY,
    LoanID INT,
    PaymentDate DATE,
    Amount DECIMAL(18, 2),
    Currency VARCHAR(4),
    Status VARCHAR(20),
    FOREIGN KEY (LoanID) REFERENCES Loans(LoanID)
);

CREATE TABLE CreditCards (
    CardID INT PRIMARY KEY,
    CustomerID INT,
    CardNumber VARCHAR(20),
    CardType VARCHAR(20),
    ExpiryDate DATE,
    CreditLimit DECIMAL(18, 2),
    Balance DECIMAL(18, 2),
    Status VARCHAR(20),
    FOREIGN KEY (CustomerID) REFERENCES Customers(CustomerID)
);

CREATE TABLE CardTransactions (
    CardTransactionID INT PRIMARY KEY,
    CardID INT,
    TransactionDate DATE,
    Amount DECIMAL(18, 2),
    MerchantName VARCHAR(100),
    Currency VARCHAR(4),
    Status VARCHAR(20),
    FOREIGN KEY (CardID) REFERENCES CreditCards(CardID)
);

CREATE TABLE Employees (
    EmployeeID INT PRIMARY KEY,
    BranchID INT,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    Position VARCHAR(50),
    HireDate DATE,
    Salary DECIMAL(18, 2),
    Email VARCHAR(100),
    PhoneNumber VARCHAR(20),
    FOREIGN KEY (BranchID) REFERENCES Branches(BranchID)
);

CREATE TABLE ATMs (
    ATMID INT PRIMARY KEY,
    BranchID INT,
    Location VARCHAR(255),
    InstallationDate DATE,
    Status VARCHAR(20),
    CashAvailable DECIMAL(18, 2),
    FOREIGN KEY (BranchID) REFERENCES Branches(BranchID)
);

CREATE TABLE Deposits (
    DepositID INT PRIMARY KEY,
    CustomerID INT,
    DepositType VARCHAR(20),
    Amount DECIMAL(18, 2),
    InterestRate DECIMAL(5, 2),
    StartDate DATE,
    MaturityDate DATE,
    Status VARCHAR(20),
    FOREIGN KEY (CustomerID) REFERENCES Customers(CustomerID)
);

CREATE TABLE DepositTransactions (
    DepositTransactionID INT PRIMARY KEY,
    DepositID INT,
    TransactionDate DATE,
    Amount DECIMAL(18, 2),
    TransactionType VARCHAR(20),
    Currency VARCHAR(4),
    Status VARCHAR(20),
    FOREIGN KEY (DepositID) REFERENCES Deposits(DepositID)
);

CREATE TABLE Services (
    ServiceID INT PRIMARY KEY,
    ServiceName VARCHAR(100),
    Description VARCHAR(255),
    Fee DECIMAL(18, 2),
    Currency VARCHAR(4),
    Status VARCHAR(20)
);

CREATE TABLE CustomerServices (
    CustomerServiceID INT PRIMARY KEY,
    CustomerID INT,
    ServiceID INT,
    SubscriptionDate DATE,
    ExpiryDate DATE,
    Status VARCHAR(20),
    FOREIGN KEY (CustomerID) REFERENCES Customers(CustomerID),
    FOREIGN KEY (ServiceID) REFERENCES Services(ServiceID)
);

CREATE TABLE InsurancePolicies (
    PolicyID INT PRIMARY KEY,
    CustomerID INT,
    PolicyType VARCHAR(50),
    CoverageAmount DECIMAL(18, 2),
    Premium DECIMAL(18, 2),
    StartDate DATE,
    EndDate DATE,
    Status VARCHAR(20),
    FOREIGN KEY (CustomerID) REFERENCES Customers(CustomerID)
);

CREATE TABLE PolicyClaims (
    ClaimID INT PRIMARY KEY,
    PolicyID INT,
    ClaimDate DATE,
    ClaimAmount DECIMAL(18, 2),
    Description VARCHAR(255),
    Status VARCHAR(20),
    FOREIGN KEY (PolicyID) REFERENCES InsurancePolicies(PolicyID)
);
































